import Detail from './detail';
import List from './list';
import { ApiCall } from '../services/Api';


class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            allElements: [],
        }
    }
    componentDidMount() {
        ApiCall()
            .then(data => console.log(data.name))
    }
    render() {
        return (
            <div>
                <p>PROBANDO QUE FUNCIONA</p>
                <List />
            </div>
        )
    }
}
export default App;
